import React, {useContext} from 'react';
import {Provider as AuthProvider} from '../src/context/AuthContext.js';
import {Context as AuthContext} from './context/AuthContext';

const App = () => {
  const {getToken} = useContext(AuthContext);

  return(
      <div>
        <button onClick={() => {
          getToken();
        }}>Test</button>
      </div>
  )
}

export default () => {
  return (
      <AuthProvider>
        <App/>
      </AuthProvider>
  )
}
